import React from 'react'
import Button from './Button'

const list=["All","Gaming","Songs","Live","Soccer","Cricket","Cooking","Valentine","T-Series","BollywoodMusic","Computer Programming","Lessons","Dramedy","Indian pop music","Kapil Sharma","Recently uploaded","Watched","New to you"];
const ButtonList = () => {
  return (
    <div className='flex  w-[1200px] overflow-hidden'>
      <Button name="Jaga Nayak"/>
      {list.map((ele)=>{
        return <Button name={ele}/>
      })}
    </div>
  )
}

export default ButtonList
